import React from 'react';

function Like({ likes, loggedUser }) {

	const liked = likes.find((like) => like.users_id === loggedUser)
	console.log(liked);
	if (liked != null) {
		return <img src="./heart_full.png" alt="" />
	} else {
		return <img src="./heart_empty.png" alt="" />
	}
}

export default Like;
